/fields/Evidence:
Hovering over Probable Cases on Today's Overview page: "Probable Case: A person is counted as a probable case if they meet one of three criteria:
1. if they have a positive antigen test;
2. if they have COVID symptoms AND were exposed to someone with COVID;
3. if they died and their death certificate lists COVID as a cause of death. Note: The number of probable cases can fluctuate from day to day; some individuals will have subsequent molecular tests that move them into the confirmed case counts." There is also a link to the CSTE position statement: https://cdn.ymaws.com/www.cste.org/resource/resmgr/ps/positionstatement2020/Interim-20-ID-02_COVID-19.pdf

